export enum Action {
  /** DELETE - 撤销操作 */
  DELETE = 0,
  /** ADD - 新增操作 */
  ADD = 1,
  UNRECOGNIZED = -1,
}

export function actionFromJSON(object: any): Action {
  switch (object) {
    case 0:
    case 'DELETE':
      return Action.DELETE;
    case 1:
    case 'ADD':
      return Action.ADD;
    case -1:
    case 'UNRECOGNIZED':
    default:
      return Action.UNRECOGNIZED;
  }
}

export function actionToJSON(object: Action): string {
  switch (object) {
    case Action.DELETE:
      return 'DELETE';
    case Action.ADD:
      return 'ADD';
    case Action.UNRECOGNIZED:
    default:
      return 'UNRECOGNIZED';
  }
}

